import React from "react";
import { Link } from "react-router-dom";
import { NavContainer, LogoHolder, Nav } from "./styling/Navbar.styled";

export const Navbar = () => {
  return (
    <NavContainer>
      <LogoHolder>
        <h1>Axios.io</h1>
      </LogoHolder>
      <Nav>
        <Link>To</Link>
      </Nav>
    </NavContainer>
  );
};
